class Solution {
    private static final int MOD = 1000000007;

    private int sumOfDigits(String s) {
        int sum = 0;
        for (char c : s.toCharArray()) sum += c - '0';
        return sum;
    }

    private int dfs(char[] num, int n, int pos, boolean limit, int sum, int[][] dp) {
        if (pos == n) return sum;
        if (!limit && dp[pos][sum] != -1) return dp[pos][sum];
        int up = limit ? num[pos] - '0' : 9;
        int ans = 0;
        for (int i = 0; i <= up; i++) {
            ans += dfs(num, n, pos + 1, limit && i == up, (sum + i) % MOD, dp);
            ans %= MOD;
        }
        if (!limit) dp[pos][sum] = ans;
        return ans;
    }

    private int countGood(String num, int minSum, int maxSum) {
        char[] digits = num.toCharArray();
        int n = digits.length;
        int[][] dp = new int[n][maxSum + 1];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j <= maxSum; j++) {
                dp[i][j] = -1;
            }
        }
        int total = 0;
        for (int i = minSum; i <= maxSum; i++) {
            total = (total + dfs(digits, n, 0, true, i, dp)) % MOD;
        }
        return total;
    }

    public int count(String num1, String num2, int min_sum, int max_sum) {
        int from = Integer.parseInt(num1);
        int to = Integer.parseInt(num2);
        int countTo = countGood(num2, min_sum, max_sum);
        int countFromMinusOne = from == 1 ? 0 : countGood(String.valueOf(from - 1), min_sum, max_sum);
        int result = (countTo - countFromMinusOne + MOD) % MOD;
        if (sumOfDigits(num1) >= min_sum && sumOfDigits(num1) <= max_sum) result = (result + 1) % MOD;
        return result;
    }
}
